define([],(()=>{const READY_MESSAGE="aiplacement_modgen_ready",CLOSE_MESSAGE="aiplacement_modgen_close",REFRESH_MESSAGE="aiplacement_modgen_refresh",notifyParent=event=>{event.preventDefault();try{window.parent.postMessage({type:REFRESH_MESSAGE},window.location.origin),window.parent.postMessage({type:CLOSE_MESSAGE},window.location.origin)}catch(error){console.error("Failed to notify parent window",error)}};return{init:()=>{try{window.parent.postMessage({type:READY_MESSAGE},window.location.origin)}catch(error){console.error("Failed to notify parent window about readiness",error)}const button=document.querySelector('[data-action="aiplacement-modgen-close"]');button&&button.addEventListener("click",notifyParent)}}}));